    false,nt"url": null,nt"notes": "This EnviroAtlas dataset portrays the total
    number of historic places located within each Census Block Group (CBG). The historic
    places data were compiled from the National Register of Historic Places, which provides
    official federal lists of districts, sites, buildings, structures and objects significant
    to American history, architecture, archeology, engineering, and culture. This dataset
    was produced by the US EPA to support research and online mapping activities related
    to EnviroAtlas. EnviroAtlas (https://www.epa.gov/enviroatlas) allows the user to
    interact with a web-based, easy-to-use, mapping application to view and analyze
    multiple ecosystem services for the contiguous United States. The dataset is available
    as downloadable data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an
    EnviroAtlas map service. Additional descriptive information about each attribute
    in this dataset can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).",nt"license_title":
